INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(2, 2019, '', 'A cidade medieval é, antes de mais nada, uma sociedade da abundância, concentrada num pequeno espaço em meio a vastas regiões pouco povoadas. Em seguida, é um lugar de produção e de trocas, onde se articulam o artesanato e o comércio, sustentados por uma economia monetária. É também o centro de um sistema de valores particular, do qual emerge a prática laboriosa e criativa do trabalho, o gosto pelo negócio e pelo dinheiro, a inclinação para o luxo, o senso da beleza. É ainda um sistema de organização de um espaço fechado com muralhas, onde se penetra por portas e se caminha por ruas e praças e que é guarnecido por torres. LE GOFF, J.; SCHMITT, J.-C. Dicionário temático do Ocidente Medieval. Bauru: Edusc, 2006.\r\n\r\n\r\n', 'No texto, o espaço descrito se caracteriza pela associação entre a ampliação das atividades urbanas e a', 'emancipação do poder hegemônico da realeza.', 'aceitação das práticas usurárias dos religiosos.', 'independência da produção alimentar dos campos.', 'superação do ordenamento corporativo dos ofícios.', 'permanência dos elementos arquitetônicos de proteção.', 'E', '', 1, 18, 1, NULL),
(3, 2018, '', 'A existência em Jerusalém de um hospital voltado para o alojamento e o cuidado dos peregrinos, assim como daqueles entre eles que estavam cansados ou doentes, fortaleceu o elo entre a obra de assistência e de caridade e a Terra Santa. Ao fazer, em 1113, do Hospital de Jerusalém um estabelecimento central da ordem, Pascoal II estimulava a filiação dos hospitalários do Ocidente a ele, sobretudo daqueles que estavam ligados à peregrinação na Terra Santa ou em outro lugar. A militarização do Hospital de Jerusalém não diminuiu a vocação caritativa primitiva, mas a fortaleceu. DEMURGER, A. Os Cavaleiros de Cristo. Rio de Janeiro:\r\n', 'O acontecimento descrito vincula-se ao fenômeno ocidental do(a)', 'surgimento do monasticismo guerreiro, ocasionado pelas cruzadas.', 'descentralização do poder eclesiástico, produzida pelo feudalismo.', 'alastramento da peste bubônica, provocado pela expansão comercial. ', 'afirmação da fraternidade mendicante, estimulada pela reforma espiritual', 'criação das faculdades de medicina, promovida pelo renascimento urbano', 'A', '', 1, 18, 1, NULL),
(4, 2018, '', 'Então disse: “Este é o local onde construirei. Tudo pode chegar aqui pelo Eufrates, o Tigre e uma rede de canais. Só um lugar como este sustentará o exército e a população geral”. Assim ele traçou e destinou as verbas para a sua construção, e deitou o primeiro tijolo com sua própria mão, dizendo: “Em nome de Deus, e em louvor a Ele. Construí, e que Deus vos abençoe”. AlLTBARI, M. Uma história dos povos árabes. São Paulo: Cia. das Letras, 1995 (adaptado).\r\n\r\n', 'A decisão do califa Al-Masur (754 – 775) de construir Bagdá nesse local orientou-se pela:', 'disponibilidade de rotas e terras férteis como base da dominação política.', 'proximidade das áreas populosas como afirmação da superfluidade bélica', 'submissão à hierarquia e à lei islâmica como controle do poder real.', 'fuga da península arábica como afastamento dos conflitos sucessórios', 'ocupação de região fronteiriça como contenção do avanço mongol.', 'A', '', 1, 18, 1, NULL),
(5, 2017, '', 'Mas era sobretudo a lã que os compradores, vindos de Flandres ou da Itália procuravam por toda a parte. Para satisfazê-los, as raças foram melhoradas através do aumento progressivo das suas dimensões. Esse crescimento prosseguiu durante todo o século XIII, e as abadias da Ordem de Cister, onde eram utilizados os métodos mais racionais de criação de gado, desempenharam certamente um papel determinante nesse aperfeiçoamento. DUBY, G. Economia rural e vida no campo no Ocidente medieval.\r\n', '  O texto aponta para a relação entre aperfeiçoamento da atividade pastoril e avanço técnico na Europa ocidental feudal, que resultou do(a)', 'crescimento do trabalho escravo.', 'desenvolvimento da vida urbana.', 'padronização dos impostos locais.', 'uniformização do processo produtivo.', 'desconcentração da estrutura fundiária.', 'B', '', 1, 18, 1, NULL),
(6, 2015, '', 'A casa de Deus, que acreditam una, está, portanto, dividida em três: uns oram, outros combatem, outros, enfim, trabalham. Essas três parte que coexistem, não suportam ser separadas; os serviços prestados por uma são a condição das obras das outras duas; cada uma por sua vez encarrega-se de aliviar o conjunto... Assim a lei pode triunfar e o mundo gozar da paz. ALDALBERON DE LAON. In: SPINOSA, F. Antologia de textos históricos medievais. Lisboa: Sá da Costa, 1981.\r\n', ' A ideologia apresentada por Aldalberon de Laon foi produzida durante a Idade Média. Um objetivo de tal ideologia e um processo que a ela se opôs estão indicados, respectivamente, em:', 'Justificação a dominação estamental revoltas camponesas.', 'Subverter a hierarquia social centralização monárquica.', 'Impedir a igualdade jurídica revoluções burguesas.', 'Controlar a exploração econômica unificação monetária', 'Questionar a ordem divina Reforma Católica', 'A', '', 1, 18, 1, NULL),
(8, 2015, '', 'No início foram as cidades. O intelectual da Idade Média — no Ocidente — nasceu com elas. Foi com o desenvolvimento urbano ligado às funções comercial e industrial — digamos modestamente artesanal — que ele apareceu, como um desses homens de ofício que se instalavam nas cidades nas quais se impôs a divisão do trabalho. Um homem cujo ofício é escrever ou ensinar, e de preferência as duas coisas a um só tempo, um homem que, profissionalmente, tem uma atividade de professor e erudito, em resumo, um intelectual – esse homem só aparecerá com as cidades. LE GOFF, J. Os intelectuais na Idade Média. Rio de Janeiro: José Olympio, 2010.\r\n \r\n', 'O surgimento da categoria mencionada no período em destaque no texto evidencia o(a)', 'apoio dado pela Igreja ao trabalho abstrato.', 'relação entre desenvolvimento urbano e divisão do trabalho.', 'importância organizacional das corporações de ofício.', 'progressiva expansão da educação escolar.', 'acúmulo de trabalho dos professores e eruditos.', 'B', '', 1, 18, 1, NULL),
(9, 2014, '', 'Sou uma pobre e velha mulher,\r\nMuito ignorante, que nem sabe ler.\r\nMostraram-me na igreja da minha terra\r\nUm Paraíso com harpas pintado\r\nE o Inferno onde fervem almas danadas,\r\nUm enche-me de júbilo, o outro me aterra.\r\nVILLON, F. In: GOMBRICH, E. História da arte. Lisboa: LTC, 1999.\r\n\r\n', 'Os versos do poeta francês François Villon fazem referência às imagens presentes nos templos católicos medievais. Nesse contexto, as imagens eram usadas com o objetivo de', 'refinar o gosto dos cristãos', 'incorporar ideais heréticos.', 'educar os fiéis através do olhar', 'divulgar a genialidade dos artistas católicos.', 'valorizar esteticamente os templos religiosos.', 'C', '', 1, 18, 1, NULL),
(10, 2014, '', 'Todo homem de bom juízo, depois que tiver realizado sua viagem, reconhecerá que é um milagre manifesto ter podido escapar de todos os perigos que se apresentam em sua peregrinação; tanto mais que há tantos outros acidentes que diariamente podem aí ocorrer que seria coisa pavorosa àqueles que aí navegam querer pô-los todos diante dos olhos quando querem empreender suas viagens. J. P. T. Histoire de plusieurs voyages aventureux. 1600. In: DELUMEAU, J. História do medo no Ocidente: 1300-1800. São Paulo: Cia. das Letras, 2009 (adaptado).\r\n \r\n', 'Esse relato, associado ao imaginário das viagens marítimas da época moderna, expressa um sentimento de', 'gosto pela aventura.', 'fascínio pelo fantástico.', 'temor do desconhecido.', 'interesse pela natureza.', 'purgação dos pecados.', 'C', '', 1, 18, 1, NULL),
(11, 2013, '', 'Quando ninguém duvida da existência de um outro mundo, a morte é uma passagem que deve ser celebrada entre parentes e vizinhos. O homem da Idade Média tem a convicção de não desaparecer completamente, esperando a ressurreição. Pois nada se detém e tudo continua na eternidade. A perda contemporânea do sentimento religioso fez da morte uma provação aterrorizante, um trampolim para as trevas e o desconhecido. DUBY, G. Ano 1000 ano 2000 na pista dos nossos medos. São Paulo: Unesp, 1998 (adaptado).\r\n \r\n', 'Ao comparar as maneiras com que as sociedades têm lidado com a morte, o autor considera que houve um processo de', 'mercantilização das crenças religiosas.', 'transformação das representações sociais.', 'disseminação do ateísmo nos países de maioria cristã.', 'diminuição da distância entre saber científico e eclesiástico.', 'amadurecimento da consciência ligada à civilização moderna', 'B', '', 1, 18, 1, NULL),
(12, 2009, '', 'A Idade Média é um extenso período da História do Ocidente cuja memória é construída e reconstruída segundo as circunstâncias das épocas posteriores. Assim, desde o Renascimento, esse período vem sendo alvo de diversas interpretações que dizem mais sobre o contexto histórico em que são produzidas do que propriamente sobre o Medievo.\r\n', '  Um exemplo acerca do que está exposto no texto acima é', 'a associação que Hitler estabeleceu entre o III Reich e o Sacro Império Romano Germânico.', 'o retorno dos valores cristãos medievais, presentes nos documentos do Concílio Vaticano II.', 'a luta dos negros sul-africanos contra o apartheid inspirada por valores dos primeiros cristãos.', 'o fortalecimento político de Napoleão Bonaparte, que se justificava na amplitude de poderes que tivera Carlos Magno.', 'a tradição heroica da cavalaria medieval, que foi afetada negativamente pelas produções cinematográficas de Hollywood.', 'A', '', 1, 18, 1, NULL),
(13, 2020, '', 'O surgimento das primeiras universidades, nos séculos XII e XIII, marca um momento capital da história do Ocidente medieval. Em relação à época anterior, esse momento comportou elementos de continuidade e de ruptura. Os primeiros devem ser buscados na localização urbana das universidades, no conteúdo dos ensinamentos, no papel social dos homens de saber. Já os elementos de ruptura foram inicialmente de ordem institucional. No âmbito das instituições educativas, este sistema era novo e original. As comunidades autônomas dos mestres e dos estudantes eram protegidas pelas mais altas autoridades leigas e religiosas daquele tempo, permitindo tanto progressos no domínio dos métodos intelectuais e em sua difusão como uma inserção mais eficiente das pessoas de saber na sociedade da época. (Adaptado de J. Verger, Cultura, ensino e sociedade no ocidente nos séculos XII e XIII. Bauru: EDUSC, 2001, p.189-190.)\r\n\r\n', 'Considerando o texto e seus conhecimentos sobre o período medieval, assinale a alternativa correta.', 'A Igreja Católica apoiava a estruturação das universidades medievais, que representavam o avanço das ciências e a superação de dogmas e das teorias teocêntricas.', 'A organização institucional diferencia as universidades medievais das corporações de ofícios, visto que seu método de estudo estava calcado na escolástica, caracterizando o atraso do mundo medieval.', 'Uma ruptura trazida pelas universidades medievais foi o início da atuação dos copistas nas bibliotecas, que copiavam sistematicamente a produção de autores latinos críticos aos dogmas religiosos.', 'A institucionalização das universidades medievais era um dado novo no período; essas instituições se caracterizavam pelo apoio das autoridades de dentro e de fora da Igreja, e pela maior autonomia e inserção social de seus membros.', '', 'D', '', 2, 18, 1, NULL),
(14, 2019, '', 'Os estudiosos muçulmanos adaptaram a herança recebida dos povos arabizados. Entre os domínios conquistados pelos muçulmanos estavam a Mesopotâmia e o antigo Egito, civilizações que desde cedo observaram os fenômenos astronômicos. O estudo dos fenômenos naturais no Crescente Fértil possibilitou a agricultura e perdurou por milênios. Nas costas do Mar Egeu, na região da Jônia, surgiram no século VI a.C. as primeiras explicações dos fenômenos naturais desvinculadas dos desígnios divinos. E as conquistas de Alexandre permitiram o início do intercâmbio entre o conhecimento grego, de um lado, e o dos antigos impérios egípcio, babilônico e persa, de outro. Além disso, houve trocas científicas e culturais com os indianos. O império árabe-islâmico foi, a partir do século VII, o herdeiro desse legado científico multicultural, ao qual os estudiosos muçulmanos deram seus aportes ao longo da Idade Média. (Adaptado de Beatriz Bissio, O mundo falava árabe. Rio de Janeiro: Civilização Brasileira, 2012, p. 200- 201.)\r\n\r\n', 'Considerando o texto acima sobre o Islã Medieval e seus conhecimentos, assinale a alternativa correta.', 'A extensão do território sob domínio islâmico e a liberdade religiosa e cultural implementada nessas áreas aceleraram a construção de novos conhecimentos pautados na cosmologia ocidental.', 'A partir do século VII, o avanço dos exércitos islâmicos garantiu a expansão do império de forma ditatorial sobre antigos núcleos culturais da Índia até as terras gregas do Império Bizantino, chegando à Espanha.', 'Os conhecimentos sobre os fenômenos naturais construídos pelos mesopotâmicos, egípcios, macedônicos, babilônicos, persas, entre outros povos, foram ignorados pelo Islã Medieval, marcado pelo fundamentalismo religioso.', 'A difusão de saberes multiculturais foi uma das marcas do Império árabe-islâmico, sendo ele a via de transmissão do sistema numérico indiano para o Ocidente e de obras da filosofia greco-romana para o Oriente.', '', 'D', '', 2, 18, 1, NULL),
(15, 2018, '', 'Estamos acostumados a considerar que o sistema centro/periferia, ao menos no Ocidente, é um eixo essencial da estrutura e do funcionamento no espaço das economias, das sociedades, das civilizações. O historiador Fernand Braudel estimou que tal sistema só existiu e funcionou plenamente a partir do século XV. Essa definição não se aplica à Cristandade Medieval sem importantes correções. A noção de centro e a oposição centro/periferia são menos decisivas que outros sistemas de orientação espacial. O principal sistema é o que opõe o baixo ao alto, quer dizer, o Aqui, esse “mundo” imperfeito e marcado pelo Pecado Original, ao céu, morada de Deus. (Adaptado de Jacques Le Goff e Jean-Claude Schmitt, “Centro/Periferia”, em Dicionário temático do ocidente medieval, v. 2. São Paulo: Edusc, 2002, p. 203.)\r\n \r\n', 'A partir do texto acima, assinale a alternativa correta.', 'Usada nas Ciências Humanas para a compreensão de períodos históricos desde a Antiguidade, a noção de centro/periferia perdura até a atualidade e estrutura o sistema econômico global contemporâneo.', 'As noções de baixo e alto têm um sentido histórico mais preciso para a compreensão da Cristandade Medieval do que o sistema centro/periferia.', 'O sistema centro/periferia é aplicável ao estudo da Cristandade Medieval, já que os feudos constituíam o centro da vida econômica e cultural naquele contexto.', 'O sistema centro/periferia aplicado durante a Era Medieval espelhava o sistema de orientação baixo e alto, sendo o baixo o mundo do pecado e o alto o mundo da virtude cristã.', '', 'B', '', 2, 18, 1, NULL),
(16, 2016, '', 'Reproduz-se, abaixo, trecho de um sermão do bispo Cesário de Arles (470-542), dirigido a uma paróquia rural.\r\n\r\n“Vede, irmãos, como quem recorre a Igreja em sua doença obtém a saúde do corpo e a remissão dos pecados. Se é possível, pois, encontrar este duplo beneficio na Igreja, por que ha infelizes que se empenham em causar mal a si mesmos, procurando os mais variados sortilégios: recorrendo a encantadores, a feitiçarias em fontes e árvores, amuletos, charlatães, videntes e adivinhos?”\r\n\r\n(Fonte: http://www.institutosapientia.com.br/site/index.php*option=co content&view=articIe&id=1397:sao-cesario-de-arIes-sermao-13- para-uma-paroquia-rural&catid=28: outros-artigos&Itemid=285 )\r\n', ' A partir desse sermão, escrito no sul da atual Franca, é correto afirmar que:', 'A Igreja Católica assumia funções espirituais e deixava a nobreza o cuidado da saúde dos camponeses, através de ordens religiosas e militares.', 'O cristianismo tinha penetrado em todas as categorias sociais e era interpretado da mesma forma através da autoridade dos bispos.', 'Praticas consideradas menos ortodoxas por Cesário de Arles ainda encontravam espaço em setores da sociedade e a elite da Igreja tentava se afirmar como o único acesso ao sagrado.', 'O avanço do materialismo estava afastando da Igreja os camponeses, que, com isto, deixavam de pagar os dízimos eclesiásticos.', '', 'C', '', 2, 18, 1, NULL),
(17, 2015, '', 'São mais ou menos constantes as queixas dos bispos e dos clérigos sobre a manutenção das práticas pagãs no mínimo até o século X. Um conjunto de práticas pagãs se mantém quase intacto, sem levar em conta festas públicas pagãs como a de 1º de janeiro, que sobreviveu durante muito tempo. (Adaptado de Michel Rouche, \'Alta Idade Média Ocidental\', em Paul Veyne (org.), História da vida privada: do Império Romano ao ano mil. São Paulo: Companhia das Letras, 2009, p.504.)\r\n', 'Assinale a alternativa correta.', 'A crítica à institucionalização da Igreja, com a consolidação da hierarquia em torno do papa e dos bispos, teve sua principal manifestação na manutenção de práticas pagãs.', 'As práticas pagãs eram costumes de origem popular respeitados pelas ordens religiosas, como os beneditinos, mas criticados pelos bispos e pelo clero tradicional.', 'A diversidade de práticas religiosas era frequente na Alta Idade Média, apesar dos esforços institucionais do alto clero católico em combater as crenças populares e defender a unidade religiosa na Europa.', 'A presença do cristianismo não significou o desaparecimento de todas as práticas religiosas consideradas pagãs, pois algumas delas foram toleradas pela Igreja, como o sabá e as festas populares.', '', 'C', '', 2, 18, 1, NULL),
(18, 2012, '', 'A longa presença de povos árabes no norte da África, mesmo antes de Maomé, possibilitou uma interação cultural, um conhecimento das línguas e costumes, o que facilitou posteriormente a expansão do islamismo. Por outro lado, deve-se considerar a superioridade bélica de alguns povos africanos, como os sudaneses, que efetivaram a conversão e a conquista de vários grupos na região da Núbia, promovendo uma expansão do Islã que não se apoia na presença árabe. (Adaptado de Luiz Arnaut e Ana Mônica Lopes, História da África: uma introdução. Belo Horizonte: Crisálida, 2005, p. 29-30.)\r\n', 'Sobre a presença islâmica na África é correto afirmar que:', 'O princípio religioso do esforço de conversão, a jihad, foi marcado pela violência no norte da África e pela aceitação do islamismo em todo o continente africano.', 'Os processos de interação cultural entre árabes e africanos, como os propiciados pelas relações comerciais, são anteriores ao surgimento do islamismo.', 'A expansão do islamismo na África ocorreu pela ação dos árabes, suprimindo as crenças religiosas tradicionais do continente.', 'O islamismo é a principal religião dos povos africanos e sua expansão ocorreu durante a corrida imperialista do século XIX', '', 'B', '', 2, 18, 1, NULL),
(20, 2018, '', 'A ideia de que a demanda de especiarias resultava da necessidade de disfarçar o gosto da carne e do peixe putrefatos é um dos grandes mitos da história da alimentação. Na Europa medieval, os alimentos frescos eram mais frescos que os atuais, pois provinham da produção local. Os alimentos em conserva mantinham se em salga, curtição, dessecação ou gordura, assim como hoje em dia são enlatados, refrigerado, liofilizado ou embalado a vácuo. De qualquer forma, os aspectos determinantes do papel desempenhado pelas especiarias na gastronomia eram o gosto e a cultura. A cozinha muito temperada com especiarias era objeto de desejo por ser cara e por “condimentar” a posição social dos ricos e as aspirações de quem ambicionava sê-lo. Além disso, a moda gastronômica predominante na baixa Idade Média europeia imitava as receitas árabes, que exigiam sabores doces e ingredientes fragrantes: leite de amêndoa, extratos de flores aromáticas e outras iguarias orientais. (Adaptado de Felipe Armesto-Fernández, 1492: o ano em que o mundo começou. São Paulo: Companhia das Letras, 2017, p.27).\r\n', 'A partir do texto acima e de seus conhecimentos históricos:', 'defina o que são as especiarias e explique seu significado social na Europa medieval.', 'explique como era feito o comércio de especiarias na baixa Idade Média.', '', 'Era esperado que os candidatos identificassem as especiarias como temperos ou condimentos usados pelos europeus para acrescentar sabor e aroma aos alimentos (por exemplo: cravo, canela, gengibre, pimenta-do-reino, noz-moscada, baunilha, entre outros ). Por serem caras, eram usadas naquele contexto histórico como um elemento de distinção, de status e de e de diferenciação de poder entre grupos sociais.', 'Era esperado que o candidato diferenciasse as práticas comerciais da baixa Idade Média e m relação à Era Moderna. Almejava-se a identificação dos contextos históricos e suas relações. O comércio das especiarias na baixa Idade Média era feito por vias terrestres e marítimas. Por via terrestre, os produtos eram transportados em rotas específicas (por exemplo, a Rota da Seda) da Ásia Central até o Mediterrâneo. A partir do Mediterrâneo, eram distribuídas por mar, por terra ou por ambas as vias para as feiras e outros centros comerciais espalhados na Europa.', '', '', 3, 18, 2, NULL),
(21, 2015, '', '\'Guerreiros a pé e cavaleiros fizeram um caminho através dos cadáveres. Mas tudo isso ainda era pouca coisa. Fomos ao Templo de Salomão, onde os sarracenos tinham o costume de celebrar seus cultos. O que se passou nestes lugares? Se dissermos a verdade, ultrapassaremos o limite do que é possível crer. Será suficiente dizer que, no Templo e no pórtico de Salomão, cavalgava-se em sangue até os joelhos dos cavaleiros e até o arreio dos cavalos. Justo e admirável julgamento de Deus, que quis que este lugar recebesse o sangue daqueles que blasfemaram contra Ele durante tanto tempo.\' (Raymond d’Aguiller, Historia Francorum qui ceperunt Jerusalem. http://www.fordham.edu/halsall/source/raymond-cde.asp#jerusalem2. Acessado em 01/10/2014.) ', 'O texto acima se refere à Primeira Cruzada (1096-1099). Responda às questões abaixo.', 'Identifique um motivo econômico e um motivo político para o movimento das Cruzadas.', 'Que grupo social liderou esse movimento e como o cronista citado identifica o apoio de Deus ao empreendimento cruzadístico?', '', 'As Cruzadas tiveram múltiplas motivações. A questão solicitava a identificação de motivações econômicas e políticas. Entre as econômicas, poderiam ser mencionadas: a conquista de territórios, a abertura de rotas comerciais em direção ao Oriente e a realização de saques. Como motivações políticas, podiam ser citadas: a tentativa de fortalecimento do papado diante do Império Bizantino e do Cristianismo Ortodoxo; o estabelecimento do antagonismo religioso dos cristãos em relação ao poder islâmico; e as questões relacionadas à expansão demográfica, que demandava novos domínios territoriais.', 'O grupo social que liderou o movimento foi a nobreza e, pelo relato do cronista, depreende-se que havia o entendimento de que a vontade divina estaria sendo cumprida pela aplicação de castigos, punições e vingança contra os que teriam invadido os lugares considerados sagrados pelos cristãos e blasfemado contra sua fé.', '', '', 3, 18, 2, NULL),
(22, 2014, '', 'No Natal de 800, o papa Leão III coroou Carlos Magno como Imperador dos Romanos. O Imperador recebeu o antigo título de Augusto.', '', 'Caracterize a autoridade de Carlos Magno como Imperador naquele momento.', 'Apresente dois aspectos do renascimento carolíngio', '', 'A coroação de Carlos Magno pelo Papa Leão III caracterizava o Imperador como detentor dos poderes religioso e militar, cujos alcances se estendiam por praticamente toda a Europa, conferindo-lhe um poder superior ao dos demais monarcas do período.', 'O Renascimento Carolíngio pode ser caracterizado pela produção artística e cultural que remete a elementos greco-romanos, germânicos e cristãos; pela criação de escolas em mosteiros, catedrais e palácios; pela valorização dos estudos clássicos como parte do dever religioso que Carlos Magno se atribuía como defensor da fé cristã.', '', '', 3, 18, 2, NULL),
(23, 2013, '', 'Tradicionalmente, a vitória dos cristãos sobre os muçulmanos na Batalha de Covadonga, na região da Península Ibérica, em 722, foi considerada o início da chamada Reconquista. Mais do que um decisivo confronto bélico, Covadonga foi uma luta dos habitantes locais por sua autonomia. A aproximação ideológica desta vitória, feita mais tarde por clérigos das Astúrias, conferiu à batalha a importância de um fato transcendente, associado ao que se considerava a missão da monarquia numa Hispânia que tombara diante dos seus inimigos.\r\n(Adaptado de R. Ramos, B. V. Sousa e N. Monteiro (orgs.), História de Portugal. Lisboa: A Esfera dos Livros, 2009, p. 17-18.)', '', 'Explique o que foi a Reconquista.', 'De que maneiras a Batalha de Covadonga foi reutilizada no discurso histórico e político pelos clérigos das Astúrias?', '', 'Esperava-se que candidato explicasse a Reconquista em seus aspectos gerais, identificando-a como um processo bélico empreendido pelos cristãos contra os muçulmanos, na Península Ibérica. As disputas militares iniciaram-se no século VIII e estenderam-se até 1492, quando ocorreu a tomada de Granada pelo reino da Espanha.', 'O vestibulando deveria identificar a apropriação do discurso histórico como um elemento ideológico e um fato transcendente, que legitimava o poder monárquico, a partir de uma suposta missão cumprida pela monarquia cristã diante dos árabes muçulmanos na Península Ibérica.', '', '', 3, 18, 2, NULL),
(24, 2012, '', 'Godrici de Finchale foi um mercador que viveu no século XI, na Baixa Idade Média, no leste da atual Inglaterra. \'Quando o rapaz, depois de ter passado os anos da infância sossegadamente em casa, chegou à idade varonil, principiou a aprender com cuidado e persistência o que ensina a experiência do mundo. Para isso decidiu não seguir a vida de lavrador, mas estudar, aprender e exercer os rudimentos de concepções mais sutis. Por esta razão, aspirando à profissão de mercador, começou a seguir o modo de vida do vendedor ambulante, aprendendo primeiro como ganhar em pequenos negócios e coisas de preço insignificante; e, então, sendo ainda um jovem, o seu espírito ousou pouco a pouco comprar, vender e ganhar com coisas de maior preço.\' (Adaptado de Reginald of Durnham, \'Libellus de Vita et Miraculis S. Godrici\', em Fernando Espinosa, Antologia de textos históricos medievais. 3ª ed., Lisboa: Sá da Costa Editora, 1981, p. 198.)', '', 'Segundo o texto, o ofício de mercador exigia uma preparação diferente daquela do lavrador. Quais eram as diferenças entre esses dois ofícios? ', 'Cite duas características do renascimento comercial e urbano ocorrido no final do período medieval.', '', 'O candidato deveria identificar as diferenças entre o lavrador e o mercador. De acordo com o texto, para exercer o ofício de mercador era necessário adquirir algum tipo de instrução, como saber calcular. Precisava ainda dominar habilidades como a de estabelecer relações de comércio. O lavrador, por sua vez, ficava preso à terra e vivia como servo. ', 'Entre as características do renascimento cultural e urbano estão: o fortalecimento dos burgos e o surgimento de um novo grupo social, a burguesia; o incremento das relações comerciais entre feudos e cidades; o surgimento de feiras, casas bancárias e corporações de ofício e a retomada do comércio de especiarias com o Oriente.', '', '', 3, 18, 2, NULL),
(25, 2011, '', 'No início do século XIV, o inquisidor Bernardo Guy escreveu um Manual do Inquisidor, no qual descrevia como se ingressava na seita herética que ficou conhecida pelo nome de pseudoapóstolos: “Perante algum altar, na presença de membros da seita, o candidato se despe de suas roupas, como sinal de renúncia a tudo que possui, para seguir com perfeição a pobreza evangélica. Também se exige que ele prometa não obedecer a nenhum mortal, mas só a Deus, como se fosse um apóstolo sujeito apenas a Cristo e a ninguém mais.” (Adaptado de Nachman Falbel, Heresias medievais. São Paulo: Perspectiva, 1977, p. 66.) ', '', 'Por quais razões essa heresia era uma ameaça para a Igreja do período? ', 'Caracterize a relação entre o poder religioso e o poder temporal na baixa Idade Média.', '', 'A heresia mencionada no texto poderia ser considerada uma ameaça ao poder da Igreja porque pregava a pobreza, enquanto a Igreja acumulava uma grande riqueza; e porque recusava a obediência ao papa e a toda a hierarquia eclesiástica. ', 'A relação entre o poder religioso e o poder temporal na baixa Idade Média pode ser caracterizada a partir de diferentes situações históricas. Por um lado, a Igreja legitimava a estratificação social, justificando a existência das três ordens (trabalhadores, guerreiros e clero) nas quais se dividia a sociedade; a Igreja também legitimava o poder político, na medida em que ungia os reis; além disso, a própria Igreja exercia o poder temporal, já que era uma grande senhora feudal; o poder temporal, o chamado “braço secular”, era quem punia os hereges que a Igreja perseguia por meio da Inquisição. Por outro lado, essa relação também se caracterizava pelo conflito entre os dois poderes, como se viu na Querela das Investiduras e na existência de dois papas simultâneos durante o cisma de Avignon. Poderia ser mencionado também que, naquele momento, o início da centralização monárquica enfraquecia o poder da Igreja.', '', '', 3, 18, 2, NULL),
(32, 2019, NULL, 'Os viajantes, missionários, administradores coloniais e etnógrafos europeus, no passado, tenderam a fundir múltiplas identidades em um único conceito de tribo. O uso da palavra tribo para descrever as sociedades africanas surgiu de um desejo de enaltecer o Estado-nação, ao mesmo tempo em que sugeria a inferioridade inerente de outros. Em resumo, conotava políticas primitivas que eram menos desenvolvidas do que as políticas dos Estados-nação. (Adaptado de John Parker e Richard Rathbone, “A ideia de África”, em História da África. Lisboa: Quimera, 2016, p. 56- 58.)', 'Baseado no texto acima e em seus conhecimentos, assinale a alternativa correta.', 'A formação e a difusão do conceito de tribo no pensamento europeu acompanharam os avanços do colonialismo na África no século XIX, legitimando o domínio de seus povos por agentes oriundos de nações que se consideravam civilizadas e superiores.', 'O conceito de tribo ganhou força no pensamento ocidental, porque na África não havia formações políticas que cobriam grandes extensões territoriais como na Europa. Ou seja, os europeus não encontraram estruturas políticas acima das unidades tribais.', 'As sociedades africanas eram organizadas a partir de pequenas tribos lideradas por chefes guerreiros, o que gerava fragmentação política e guerras, inviabilizando nesse continente a formação de unidades políticas complexas nos moldes europeus.', 'Em razão das tradições milenares e do respeito aos ancestrais, as tribos eram unidades sociais e políticas estáticas assentadas em uma identidade homogênea. Os europeus comumente desrespeitavam todas essas características na colonização.', '', 'A', '', 2, 20, 1, ''),
(33, 2017, NULL, 'Leia os versos iniciais do poema The White Man’s Burden (O fardo do homem branco).', 'O poema de Rudyard Kipling foi escrito em Londres, em 1898, após a estadia do autor nos EUA. Considerando-se o contexto do imperialismo do século XIX, o poeta expressa', 'a defesa do expansionismo norte-americano, justificado como um dever moral explicitado no título “The White Man’s Burden”.', 'o olhar caridoso em relação aos povos dominados no contexto do imperialismo do século XIX, como se observa no verso “half devil and half child”.', 'uma crítica à visão da superioridade branca vigente durante a corrida imperialista do século XIX, ao enaltecer as características “folk and wild”.', 'a visão de que as famílias americanas não devem ser punidas pela política expansionista dos EUA, como se observa na recomendação “Go send your sons to exile”', '', 'A', '', 2, 20, 1, 'Take up the White Man’s burden<br>Send forth the best ye breed -<br> Go send your sons to exile<br> To serve your captives` need<br> To wait in heavy harness<br> On fluttered folk and wild<br> Your new-caught, sullen peoples, Half devil and half child (...)<br> (Rudyard Kipling, Rudyard Kipling’s Verse. Disponível em http://kiplingsociety.co.uk/poems_burden.htm. Acessado em 17/10/2016.)'),
(34, 2013, NULL, '', 'As exposições universais do século XIX, sobretudo as de Londres e Paris, se caracterizavam', ' pelo louvor à superioridade europeia e pela apresentação otimista da técnica e da ciência.', 'pela crítica à expansão sobre a África, movimento considerado um freio ao progresso europeu.', 'pela crítica marxista aos princípios burgueses dominantes nos centros urbanos europeus.', 'pelo elogio das sociedades burguesas associadas às vanguardas da época, como o Cubismo, o Dadaísmo e o Surrealismo.', '', 'A', '', 2, 20, 1, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(37, 2018, , 'O orientalismo é um estilo de pensamento baseado em uma distinção entre Oriente e Ocidente. Quando o orientalista culto viajava para o país de sua especialização, ia sempre acompanhado de máximas inabaláveis sobre a “civilização” que estudara; eram raros os orientalistas que tinham outro interesse que não o de provar poeirentas “verdades”, aplicando-as aos nativos que não os entendiam e, portanto, eram degenerados. O Oriente precisava primeiro ser conhecido, depois invadido e possuído, e então recriado por estudiosos. (Adaptado de Edward Said, Orientalismo. São Paulo: Companhia das Letras, 1990).', 'Considerando o texto e o quadro acima reproduzido e seus conhecimentos, responda às questões:', 'Segundo Edward Said, o que era o orientalismo?', 'Identifique um elemento do Orientalismo no quadro do pintor italiano Giulio Rosati (1858-1917) e explique esse elemento.', '', 'Essa alternativa tinha como objetivo estimular a reflexão dos candidatos sobre o conceito de orientalismo (descrito no texto apresentado). Era esperado que os candidatos identificassem que o orientalismo é uma lançada pelo Ocidente, pautada especialmente em um discurso de poder eurocêntrico que distinguia no Oriente elementos estereotipados e exóticos. No orientalismo, práticas culturais, artísticas, religiosas, sociais e políticas que se diferenciassem das europeias eram tidas como inferiores, abrindo espaço para que discursos de poder centrados na ideia da superioridade civilizacional europeia, que fortaleciam práticas como o colonialismo e o imperialismo.', 'Era esperado que o candidato utilizasse a imagem da questão como um documento histórico, operando a leitura dessa imagem junto ao conceito de imperialismo trabalhado na alternativa anterior. O candidato, portanto, deveria identificar um elemento orientalista na pintura (retratação do cenário de um harém ou aspectos do exotismo retratados na dança da mulher que tem seus seios expostos, entre outros), que reforçavam a premissa de que o Ocidente inventava um Oriente; sempre sedutor, exótico, letárgico, etc', '', NULL, 3, 20, 2, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(39, 2015, , 'Os calendários são fontes históricas importantes, na medida em que expressam a concepção de tempo das sociedades. Essas imagens compõem um calendário medieval (1460-1475) e cada uma delas representa um mês, de janeiro a dezembro.', 'Com base na análise do calendário, apreende-se uma concepção de tempo:', 'cíclica, marcada pelo mito arcaico do eterno retorno.', 'humanista, identificada pelo controle das horas de atividade por parte do trabalhador', 'escatológica, associada a uma visão religiosa sobre o trabalho.', 'natural, expressa pelo trabalho realizado de acordo com as estações do ano.', 'romântica, definida por uma visão bucólica de sociedade.', 'D', '', 1, 18, 1, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(40, 2011, , '', 'No quadro acima, observa-se a organização espacial do trabalho agrícola típica do período medieval. A partir dele, podemos afirmar que', 'os camponeses estão distantes do castelo porque já abandonavam o domínio senhorial, num momento em que práticas de conservação do solo, como a rotação de culturas, e a invenção de novos instrumentos, como o arado, aumentavam a produção agrícola.', 'os camponeses utilizavam, então, práticas de plantio direto, o que permitia a melhor conservação do solo e a fertilidade das terras que pertenciam a um senhor feudal, como sugere o castelo fortificado que domina a paisagem ao fundo do quadro.', 'um castelo fortificado domina a paisagem, ao fundo, pois os camponeses trabalhavam no domínio de um senhor; pode-se ver também que utilizavam práticas de rotação de culturas, visando à conservação do solo e à manutenção da fertilidade das terras.', 'A cena retrata um momento de mudança técnica e social: desenvolviam-se novos instrumentos agrícolas, como o arado, e o uso de práticas de plantio direto, o que levava ao aumento da produção, permitindo que os camponeses abandonassem o domínio senhorial.', '', 'C', '', 2, 18, 1, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(41, 2018, '', 'O século XVIII é, por diversas razões, um século diferenciado. Razão e experimentação se aliavam no que se acreditava ser o verdadeiro caminho para o estabelecimento do conhecimento científico, por tanto tempo almejado. O fato, a análise e a indução passavam a ser parceiros fundamentais da razão. É ainda no século XVIII que o homem começa a tomar consciência de sua situação na história. ODALIA, N. In: PINSKY, J.; PINSKY, C. B. História da cidadania.', 'No ambiente cultural do Antigo Regime, a discussão filosófica mencionada no texto tinha como uma de suas características a', 'aproximação entre inovação e saberes antigos.', 'conciliação entre revelação e metafísica platônica.', 'vinculação entre escolástica e práticas de pesquisa.', 'separação entre teologia e fundamentalismo religioso.', 'contraposição entre clericalismo e liberdade de pensamento.', 'E', '', 1, 19, 1, ''),
(42, 2013, '', 'O estudo da Ilustração nunca mais foi o mesmo após o holocausto, durante a Segunda Guerra Mundial. A crença ingênua no poder regenerador da razão inviabilizou-se. Estilhaçou-se a cômoda certeza de que as Luzes foram a filosofia da burguesia triunfante, e dos quatro pontos da Europa surgiram evidências acerca da amplitude e variação do fenômeno, que não caberia mais considerar nem apenas burguês, nem eminentemente francês, nem restrito ao século XVIII. (Adaptado de Laura de Mello e Souza, em http://www.revistadehistoria.com.br/secao/artigos/as-paixoesintelectuais. Acessado em 20/08/2012.)', 'A partir do texto, é correto afirmar que:', 'A experiência do holocausto, no século XX, pode ser interpretada como a negação do projeto das Luzes, porque rejeita a eficácia do poder do Estado.', 'A compreensão das Luzes não se prende à explicação do triunfo da burguesia, exigindo um estudo mais amplo sobre seus impactos na Europa.', 'O projeto das Luzes difundia o ideário do progresso e, contraditoriamente, ensejava o conhecimento científico.', 'O ideário das Luzes ajuda a compreender as revoluções liberais dos séculos XVIII e XIX, que defendiam a intolerância religiosa.', '', 'B', '', 2, 19, 1, ''),
(43, 2013, '', '“O homem nasce livre, e por toda a parte encontra-se a ferros. O que se crê senhor dos demais não deixa de ser mais escravo do que eles. (...) A ordem social, porém, é um direito sagrado que serve de base a todos os outros. (...) Haverá sempre uma grande diferença entre subjugar uma multidão e reger uma sociedade. Sejam homens isolados, quantos possam ser submetidos sucessivamente a um só, e não verei nisso senão um senhor e escravos, de modo algum considerando-os um povo e seu chefe. Trata-se, caso se queira, de uma agregação, mas não de uma associação; nela não existe bem público, nem corpo político.” (Jean-Jacques Rousseau, Do Contrato Social. [1762]. São Paulo: Ed. Abril, 1973, p. 28,36.)', 'No trecho apresentado, o autor', 'argumenta que um corpo político existe quando os homens encontram-se associados em estado de igualdade política.', 'reconhece os direitos sagrados como base para os direitos políticos e sociais.', 'defende a necessidade de os homens se unirem em agregações, em busca de seus direitos políticos.', 'denuncia a prática da escravidão nas Américas, que obrigava multidões de homens a se submeterem a um único senhor.', '', 'A', '', 2, 19, 1, ''),
(44, 2012, '', '“O homem nasce livre, e por toda a parte encontra-se a ferros. O que se crê senhor dos demais não deixa de ser mais escravo do que eles. (...) A ordem social, porém, é um direito sagrado que serve de base a todos os outros. (...) Haverá sempre uma grande diferença entre subjugar uma multidão e reger uma sociedade. Sejam homens isolados, quantos possam ser submetidos sucessivamente a um só, e não verei nisso senão um senhor e escravos, de modo algum considerando-os um povo e seu chefe. Trata-se, caso se queira, de uma agregação, mas não de uma associação; nela não existe bem público, nem corpo político.” (Jean-Jacques Rousseau, Do Contrato Social. [1762]. São Paulo: Ed. Abril, 1973, p. 28,36.)', ' Sobre Do Contrato Social, publicado em 1762, e seu autor, é correto afirmar que:', 'Rousseau, um dos grandes autores do Iluminismo, defende a necessidade de o Estado francês substituir os impostos por contratos comerciais com os cidadãos.', 'A obra inspirou os ideais da Revolução Francesa, ao explicar o nascimento da sociedade pelo contrato social e pregar a soberania do povo.', 'Rousseau defendia a necessidade de o homem voltar a seu estado natural, para assim garantir a sobrevivência da sociedade.', 'O livro, inspirado pelos acontecimentos da Independência Americana, chegou a ser proibido e queimado em solo francês.', '', 'B', '', 2, 19, 1, ''),
(45, 2011, '', 'Na segunda metade do século XVIII, pensadores importantes, como Denis Diderot, atacaram os próprios fundamentos do imperialismo. Para esse filósofo, os seres humanos eram fundamentalmente formados pelas suas culturas e marcados pelas diferenças culturais, não existindo o homem no estado de natureza. Isso levava à ideia de relatividade cultural, segundo a qual os povos não podiam ser considerados superiores ou inferiores a partir de uma escala universal de valores. (Adaptado de Sankar Muthu, Enlightenment Against Empire. Princeton: Princeton University Press, 2003, p. 258, 268.)', '', ' Segundo o texto, como as ideias de Denis Diderot se opunham ao imperialismo? ', 'No pensamento de Jean-Jacques Rousseau, qual a relação entre a ideia de “homem no estado de natureza” e a organização das sociedades civilizadas?', '', 'Segundo o texto, as ideias de Diderot se opunham ao imperialismo por afirmar que as diferenças culturais são próprias do ser humano, o que leva à relatividade cultural; dessa maneira não há uma escala universal de valores, nem pode haver culturas consideradas superiores ou inferiores. ', 'No pensamento de Rousseau, o homem é naturalmente bom e a vida em sociedade o corrompe; nessa passagem do estado de natureza para a civilização, têm origem as desigualdades e a propriedade privada, tornando-se necessário um contrato social. Por meio do contrato social, que organiza as sociedades civilizadas, cada indivíduo abdica de seus direitos em nome do Estado, que deve defendê-lo, devendo a vontade geral nortear as decisões do Estado.', '', NULL, 3, 19, 2, ''),
(46, 2018, '', 'Os soviéticos tinham chegado a Cuba muito cedo na década de 1960, esgueirando-se pela fresta aberta pela imediata hostilidade norte-americana ao processo social revolucionário. Durante três décadas os soviéticos mantiveram sua presença em Cuba com bases e ajuda militar, mas, sobretudo, com todo o apoio econômico que, como saberíamos anos mais tarde, mantinha o país à tona, embora nos deixasse em dívida com os irmãos soviéticos – e depois com seus herdeiros russos – com cifras que chegavam a US$ 32 bilhões. Ou seja, o que era oferecido em nome da solidariedade socialista tinha um preço definido. (PADURA, L. Cuba e os russos. Folha de São Paulo)', 'O texto indica que durante a Guerra Fria as relações internas em um mesmo bloco foram marcadas pelo(a)', 'busca da neutralidade política.', 'estímulo à competição comercial. ', 'subordinação à potência hegemônica.', 'elasticidade das fronteiras geográficas', 'compartilhamento das pesquisas científicas', 'C', '', 1, 17, 1, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(49, 2012, , 'Com sua entrada no universo dos gibis, o Capitão chegaria para apaziguar a agonia, o autoritarismo militar e combater a tirania. Claro que, em tempos de guerra, um gibi de um herói com uma bandeira americana no peito aplicando um sopapo no Führer só poderia ganhar destaque, e o sucesso não demoraria muito a chegar. COSTA, C. Capitão América, o primeiro vingador: crítica. Disponível em: www.revistastart.com.br. Acesso em: 27 jan. 2012 (adaptado).', 'A capa da primeira edição norte-americana da revista do Capitão América demonstra sua associação com a participação dos Estados Unidos na luta contra  ', 'a Tríplice Aliança, na Primeira Guerra Mundial.', 'os regimes totalitários, na Segunda Guerra Mundial.', 'o poder soviético, durante a Guerra Fria.', 'o movimento comunista, na Guerra do Vietnã.', 'o terrorismo internacional, após 11 de setembro de 2001', 'B', '', 1, 17, 1, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(50, 2009, '', 'A primeira metade do século XX foi marcada por conflitos e processos que a inscreveram como um dos mais violentos períodos da história humana.', 'Entre os principais fatores que estiveram na origem dos conflitos ocorridos durante a primeira metade do século XX estão', 'a crise do colonialismo, a ascensão do nacionalismo e do totalitarismo.', 'o enfraquecimento do império britânico, a Grande Depressão e a corrida nuclear.', 'o declínio britânico, o fracasso da Liga das Nações e a Revolução Cubana.', 'a corrida armamentista, o terceiro-mundismo e o expansionismo soviético.', 'a Revolução Bolchevique, o imperialismo e a unificação da Alemanha', 'A', '', 1, 17, 1, ''),
(51, 2009, '', 'Do ponto de vista geopolítico, a Guerra Fria dividiu a Europa em dois blocos. Essa divisão propiciou a formação de alianças antagônicas de caráter militar, como a OTAN, que aglutinava os países do bloco ocidental, e o Pacto de Varsóvia, que concentrava os do bloco oriental. É importante destacar que, na formação da OTAN, estão presentes, além dos países do oeste europeu, os EUA e o Canadá. Essa divisão histórica atingiu igualmente os âmbitos político e econômico que se refletia pela opção entre os modelos capitalista e socialista.', 'Essa divisão europeia ficou conhecida como  ', 'Cortina de Ferro.', 'Muro de Berlim.', 'União Europeia.', 'Convenção de Ramsar.', 'Conferência de Estocolmo.', 'A', '', 1, 17, 1, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(52, 2019, , 'A propaganda através de inscrições e desenhos em muros e paredes é uma parte integrante da Paris revolucionária de Maio de 1968. Ela se tornou uma atividade de massa, parte e parcela do método de autoexpressão da Revolução.', 'Considerando o texto e a imagem anteriores, assinale a alternativa correta sobre o movimento de maio de 1968.  ', 'Influenciadas pela política de Estado da União Soviética, as manifestações de 1968 foram desencadeadas pelos operários franceses, que exigiam melhores condições de trabalho, por meio das pichações em muros espalhados pela cidade', 'Influenciadas pelo contexto cultural da Guerra Fria, as manifestações de 1968 tinham como palavras de ordem a liberdade de expressão política e sexual, como se via nas inscrições nos muros de Paris.', 'Influenciadas pelos movimentos punk-anarquistas ingleses, as manifestações de 1968 na França foram responsáveis pelo enfraquecimento do então presidente Charles De Gaulle e seu lema aparecia em inscrições nos muros.', 'Influenciadas por ideias esquerdistas, comunistas e anarquistas, as manifestações de 1968 ficaram restritas às camadas populares francesas, sendo que as inscrições nos muros das cidades indicavam o grupo social responsável', '', 'B', '', 2, 17, 1, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(53, 2013, '', 'Em discurso proferido no dia 12/03/1947, o presidente dos EUA, Harry Truman, afirmou: “O governo grego tem operado numa atmosfera de caos e extremismo. A extensão da ajuda a esse país não quer dizer que os Estados Unidos estão de acordo com tudo o que o seu governo tem feito ou fará. No momento atual da história do mundo quase todas as nações se veem na contingência de escolher entre modos alternativos de vida. E a escolha, frequentes vezes, não é livre.” (Harold C. Syrett (org.), Documentos Históricos dos Estados Unidos. São Paulo: Cultrix, 1980, p. 316-317.)', 'Considerando o discurso do presidente Truman, bem como os processos históricos do pós-Segunda Guerra Mundial, é correto afirmar que:', 'A “contingência de escolher entre modos alternativos de vida” se referia à escolha entre o fascismo alemão e a democracia liberal.', 'O caos do governo grego era uma referência aos problemas da Grécia com o Mercado Comum Europeu e a necessidade de ajuda ao governo de Atenas.', 'O discurso nasceu do declínio do auxílio britânico na região da Grécia e da ascensão norte-americana no contexto da Guerra Fria.', 'O discurso é uma resposta ao Plano Marshall, que o governo de Londres tentava impor à Grécia, por meio do Banco Central Europeu.', '', 'C', '', 2, 17, 1, ''),
(54, 2011, '', 'Para muitos norte-americanos, Vietnã é o nome de uma guerra, não de um país. Os vietnamitas parecem figuras sombrias, sem nome nem rosto, vítimas desamparadas ou agressores cruéis. A história começa apenas quando os Estados Unidos entram em cena. (Adaptado de Marvin E. Gettleman et. alli (Ed.), Vietnam and America: a documented history. New York: Grove Press, 1995, p. xiii.)', 'Esse desconhecimento dos norte-americanos quanto a seus adversários na Guerra do Vietnã pode ser relacionado ao fato de os norte-americanos', 'promoverem uma guerra de trincheiras, enquanto os vietnamitas comunistas movimentavam seus batalhões pela selva. Contando com um forte apoio popular, os Estados Unidos permaneceram por anos nesse conflito, mas não conseguiram derrotar os vietnamitas.', 'invadirem e ocuparem o território vietnamita, desmantelando os batalhões comunistas graças à superioridade americana em treinamento militar e armamentos. Apesar do apoio popular à guerra, os Estados Unidos desocuparam o território vietnamita.', 'desconhecerem as tradições dos vietnamitas, organizados em torno de líderes tribais, que eram os chefes militares de seus clãs. Sem ter um Estado como adversário, o conflito se arrastou e, sem apoio popular, os Estados Unidos acabaram se retirando.', 'encontrarem grande dificuldade em enfrentar as táticas de guerrilha dos vietnamitas comunistas, que tinham maior conhecimento territorial. Após várias derrotas e sem apoio popular em seu próprio país, os Estados Unidos retiraram suas tropas do Vietnã.', '', 'D', '', 2, 17, 1, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(61, 2017, , 'A charge de Carlos Latuff, publicada em 2016, faz associações sobre diversos processos do mundo contemporâneo. A primeira-ministra britânica, Theresa May, ouve uma voz enquanto carrega tijolos para a construção de um polêmico muro em Calais, na França.', '', 'Explique qual é a justificativa histórica para a exclamação “hipócritas” oriunda do muro de Berlim.', 'Por que a questão dos muros tornou-se um assunto recorrente na política internacional do século XXI? Justifique sua resposta a partir de uma das referências da charge.', '', 'A charge de Carlos Latuff, publicada em 2016, ironiza a posição da Inglaterra, representada pela figura da primeira-ministra britânica Thereza May, pertencente ao Partido Conservador, de defender a construção de novos muros que supostamente poderiam impedir a entrada de imigrantes em países europeus, como a Inglaterra e a França. O muro em construção na charge (sendo cimentado por um operário sem rosto) refere-se a Calais, acampamento de refugiados vindos do Afeganistão, Sudão e Eritreia, situado no norte da França. A hipocrisia, estampada no vestígio material do muro de Berlim, viria do fato de que a Inglaterra, ao longo de todo o período marcado pelo conflito da Guerra Fria, foi uma das nações defensoras da derrubada desse muro, que simbolizava a divisão do mundo entre capitalismo e comunismo. Dessa forma, a contradição estaria na mudança de postura das nações que se posicionavam como defensora da liberdade ao longo da segunda metade do século XX, mas, agora, estariam defendendo o fe', 'A construção de muros expressa a ampliação dos discursos xenofóbicos, isolacionistas e ultrarreligiosos que estão presentes em diversas partes do mundo atual. Com o avanço dos partidos conservadores na liderança de diversas nações do mundo houve uma reconfiguração da política internacional e a tentativa de restrição à circulação de pessoas consideradas indesejadas, como os refugiados e os imigrantes ilegais. Os muros indicados na charge são exemplos do fortalecimento de discursos de ódio e preconceitos, como se observa nos muros já existentes na Palestina, nos EUA/México e na proposta do muro de Calais.', '', NULL, 3, 17, 2, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(62, 2014, , 'O cartaz abaixo foi usado pela propaganda soviética contra o capitalismo ocidental, durante o período da Guerra Fria. O texto diz: “Duas infâncias. Na URSS (parte superior) crianças são apoiadas pelo amor da nação! Nos países capitalistas (figura inferior), milhões de crianças vivem sem comida ou abrigo.”', '', 'Como o cartaz descreve a sociedade capitalista ocidental?', 'Cite dois conflitos bélicos do período da Guerra Fria.', '', 'A propaganda soviética faz uma crítica a sociedade capitalista no que diz respeito aos cuidados com a infância, representando, na parte inferior da imagem, crianças em um ambiente degradado e marcado pela pobreza, consequência das injustiças sociais e econômicas que os socialistas atribuem no sistema capitalista.', 'Poderiam ser citados conflitos bélicos ocorridos na Ásia (Guerra da Coreia, Guerra do Vietnã), na África (lutas de descolonização), na América (Crise dos Misseis e Invasão da Baia dos Porcos em Cuba) e no Oriente Médio.', '', NULL, 3, 17, 2, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(63, 2014, '', 'Três décadas — de 1884 a 1914 — separam o século XIX — que terminou com a corrida dos países europeus para a África e com o surgimento dos movimentos de unificação nacional na Europa — do século XX, que começou com a Primeira Guerra Mundial. É o período do Imperialismo, da quietude estagnante na Europa e dos acontecimentos empolgantes na Ásia e na África. ARENDT, H. As origens do totalitarismo. São Paulo: Cia. das Letras, 2012.', 'O processo histórico citado contribuiu para a eclosão da Primeira Grande Guerra na medida em que:', 'difundiu as teorias socialistas.', 'acirrou as disputas territoriais.', 'superou as crises econômicas.', ' multiplicou os conflitos religiosos', 'conteve os sentimentos xenófobos.', 'B', '', 1, 25, 1, ''),
(64, 2015, '', 'O relato a seguir é parte da biografia de um homem que passou sua infância no atual Mali. Em novembro de 1918, a África, como a metrópole, festejou o fim da Grande Guerra Mundial e a vitória da França e seus aliados (…). Estávamos orgulhosos do papel desempenhado pelos soldados africanos na frente de batalha. (…) Os sobreviventes que voltaram em 1918- 1919 foram a causa de um novo fenômeno social que influiu na evolução da mentalidade nativa. Estou falando do fim do mito do homem branco como ser invencível e sem defeitos. (Amadou Hampâté Bâ, Amkoullel, o menino fula. São Paulo: Palas Athena/Casa das Áfricas, 2003, p. 312-313.)', 'Considerando o relato acima, é correto afirmar que', 'a presença dos soldados africanos contribuiu para construir uma identidade africana sustentada nos princípios bélicos do imperialismo europeu.', 'a presença de soldados africanos nos conflitos contribuiu para o questionamento do mito da superioridade do homem branco.', 'o autor, ao apresentar a fragilidade do homem branco, instaurou um discurso inverso de superioridade dos africanos.', 'o autor, ao apresentar o norte da África como parte da França, exaltou o projeto imperialista francês e suas estratégias de integração cultural.', '', 'B', '', 2, 25, 1, ''),
(65, 2019, '', 'O período de 1840 a 1890 é o do triunfo da ideologia do progresso, simultaneamente ao grande boom econômico e industrial do Ocidente. (Adaptado de Jacques Le Goff, História e memória. Campinas: Editora da Unicamp, 1990, p. 204-245.)', 'Com base no texto e em seus conhecimentos históricos,', 'apresente duas características importantes do boom econômico e industrial do Ocidente entre 1840 e 1890;', 'explique o ideário do progresso e o relacione com a Primeira Guerra Mundial.', '', 'São características do boom econômico e industrial do Ocidente entre 1840 e 1890: a Revolução Industrial em seu segundo momento, em que se destacam grandes inovações tecnológicas como a eletricidade, o uso do petróleo, o desenvolvimento das ferrovias etc.; o Imperialismo, com o neocolonialismo avançando sobre territórios como a África e a Ásia; a ampliação de mercados consumidores, especialmente aqueles reconhecidos como periféricos; a primazia da Inglaterra vitoriana como Império de destaque no período; o crescimento urbano, com intensa exploração das classes operárias e precarização de suas condições de vida nas cidades.', 'O ideário de progresso do século XIX poderia ser identificado como uma característica marcante do período. Propunha a permanente evolução das sociedades rumo a um futuro sempre mais promissor que o presente. Nesse sentido, trazia um culto ao desenvolvimento tecnológico e à ciência, que estabeleciam um padrão europeu para se pensar um mundo civilizado. Esse ideário poderia ser relacionado à Primeira Guerra Mundial na medida em que o desenvolvimento tecnológico foi amplamente demonstrado por meio das inovações bélicas postas em uso nesse conflito. Ele favoreceu também o nacionalismo e a ideia de superioridade europeia, que legitimou a subjugação de múltiplos territórios, levando a conflitos pelo domínio colonial e ao colapso do próprio imperialismo.', '', NULL, 3, 25, 2, ''),
(66, 2017, '', 'O New Deal visa restabelecer o equilíbrio entre o custo de produção e o preço, entre a cidade e o campo, entre os preços agrícolas e os preços industriais, reativar o mercado interno — o único que é importante —, pelo controle de preços e da produção, pela revalorização dos salários e do poder aquisitivo das massas, isto é, dos lavradores e operários, e pela regulamentação das condições de emprego. CROUZET, M. História geral das civilizações.', 'Tendo como referência os condicionantes históricos do entreguerras, as medidas governamentais descritas objetivavam', 'flexibilizar as regras do mercado financeiro', 'fortalecer o sistema de tributação regressiva.', 'introduzir os dispositivos de contenção creditícia.', 'racionalizar os custos da automação industrial mediante negociação sindical.', 'recompor os mecanismos de acumulação econômica por meio da intervenção estatal.', 'E', '', 1, 28, 1, ''),
(67, 2017, '', 'E venham, então, os alegres incendiários de dedos carbonizados! Vamos! Ateiem fogo às estantes das bibliotecas! Desviem os cursos dos canais, para inundar os museus! Empunhem as picaretas, os machados, os martelos e deitem abaixo sem piedade as cidades veneradas. MARINETI, F. Manifesto futurista).', 'Que princípio marcante do Futurismo e comum a várias correntes artísticas e culturais das primeiras três décadas do século XX está destacado no texto?', 'A tradição é uma força incontornável.', 'A arte é expressão da memória coletiva.', 'A modernidade é a superação decisiva da história.', 'A realidade cultural é determinada economicamente.', 'A memória é um elemento crucial da identidade cultural', 'C', '', 1, 28, 1, ''),
(68, 2013, '', 'As Brigadas Internacionais foram unidades de combatentes formadas por voluntários de 53 nacionalidades dispostos a lutar em defesa da República espanhola. Estima-se que cerca de 60 mil cidadãos de várias partes do mundo – incluindo 40 brasileiros – tenham se incorporado a essas unidades. Apesar de coordenadas pelos comunistas, as Brigadas contaram com membros socialistas, liberais e de outras correntes político-ideológicas. SOUZA, I. I. A Guerra Civil Europeia. História Viva, n. 70, 2009 (fragmento).', 'A Guerra Civil Espanhola expressou as disputas em curso na Europa na década de 1930:', 'crítica ao stalinismo.', 'combate ao fascismo.', 'rejeição ao federalismo.', 'apoio ao corporativismo.', 'adesão ao anarquismo', 'B', '', 1, 28, 1, ''),
(69, 2012, '', 'Texto I  A Europa entrou em estado de exceção, personificado por obscuras forças econômicas sem rosto ou localização física conhecida que não prestam contas a ninguém e se espalham pelo globo por meio de milhões de transações diárias no ciberespaço. ROSSI, C. Nem fim do mundo nem mundo novo. Folha de São Paulo, 11 dez. 2011 (adaptado).  Texto II  Estamos imersos numa crise financeira como nunca tínhamos visto desde a Grande Depressão iniciada em 1929 nos Estados Unidos. Entrevista de George Soros. Disponível em: www.nybooks.com. Acesso em: 17 ago. 2011 (adaptado).', 'A comparação entre os significados da atual crise econômica e do crash de 1929 oculta a principal diferença entre essas duas crises, pois', 'o crash da Bolsa em 1929 adveio do envolvimento dos EUA na I Guerra Mundial e a atual crise é o resultado dos gastos militares desse país nas guerras do Afeganistão e Iraque.', 'a crise de 1929 ocorreu devido a um quadro de superprodução industrial nos EUA e a atual crise resultou da especulação financeira e da expansão desmedida do crédito bancário.', 'a crise de 1929 foi o resultado da concorrência dos países europeus reconstruídos após a I Guerra e a atual crise se associa à emergência dos BRICS como novos concorrentes econômicos.', 'o crash da Bolsa em 1929 resultou do excesso de proteções ao setor produtivo estadunidense e a atual crise tem origem na internacionalização das empresas e no avanço da política de livre mercado.', 'a crise de 1929 decorreu da política intervencionista norte-americana sobre o sistema de comércio mundial e a atual crise resultou do excesso de regulação do governo desse país sobre o sistema monetário.', 'B', '', 1, 28, 1, ''),
(70, 2020, '', ' Na Era da Catástrofe (1914-1945), com a Grande Depressão desencadeada pela crise de 1929, tornava-se cada vez mais claro que a paz, a estabilidade social, a economia, as instituições políticas e os valores intelectuais da sociedade liberal burguesa entraram em decadência ou colapso. (Adaptado de E. J. Hobsbawm, Era dos extremos: o breve século XX, 1914-1991. São Paulo: Companhia das Letras, 1995, p. 112.)', 'A partir do excerto acima e dos conhecimentos sobre o período histórico que vai de 1914 a 1945, é correto afirmar:', 'A crise de 1929 e as guerras mundiais levaram ao colapso do liberalismo político e econômico na Europa e, ao mesmo tempo, à expansão das democracias liberais em países africanos e do Oriente Médio.', 'As soluções para a crise de 1929 centraram-se em um aprofundamento das políticas liberais do New Deal, que promoviam responsabilidade fiscal e diminuição do papel do Estado como motor de desenvolvimento.', 'São marcos da crise do liberalismo na Europa: o colapso das principais democracias, a ascensão de governos totalitários e autoritários e a descrença no livre-mercado após a crise de 1929.', 'Verificou-se nesse período o colapso das democracias liberais, com a ascensão do totalitarismo na Europa, e o aumento das liberdades econômicas, com a diminuição do papel do Estado como solução para a crise de 1929.', '', 'C', '', 2, 28, 1, ''),
(71, 2017, '', 'Após a Declaração Universal dos Direitos Humanos pela ONU, em 1948, a Unesco publicou estudos de cientistas de todo o mundo que desqualificam as doutrinas racistas e demonstraram a unidade do gênero humano. Desde então, a maioria dos próprios cientistas europeus passou a reconhecer o caráter discriminatório da pretensa superioridade racial do homem branco e a condenar as aberrações cometidas em seu nome. SILVEIRA, R.', 'A posição assumida pela Unesco, a partir de 1948, foi motivada por acontecimentos então recentes, dentre os quais se destacava o(a)', 'ataque feito pelos japoneses à base militar americana de Pearl Harbor.', 'desencadeamento da Guerra Fria e de novas rivalidades entre nações. ', 'morte de milhões de soldados nos combates da Segunda Guerra Mundial.', 'execução de judeus e eslavos presos em guetos e campos de concentração nazistas.', 'lançamento de bombas atômicas em Hiroshima e Nagasaki pelas forças norte-americanas.', 'D', '', 1, 26, 1, ''),
(72, 2015, '', 'A participação da África na Segunda Guerra Mundial deve ser apreciada sob a ótica da escolha entre vários demônios. O seu engajamento não foi um processo de colaboração com o imperialismo, mas uma luta contra uma forma de hegemonia ainda mais perigosa. MAZRUI, A. “Procurai primeiramente o reino político”. (Org.). História geral da África: África desde 1925. Brasília: Unesco, 2010.', 'Para o autor, a “forma de hegemonia” e uma de suas características que explicam o engajamento dos africanos no processo analisado foram:', 'Comunismo / rejeição da democracia liberal.', 'Capitalismo / devastação do ambiente natural.', 'Fascismo / adoção do determinismo biológico.', 'Socialismo / planificação da economia nacional', 'Colonialismo / imposição da missão civilizatória.', 'C', '', 1, 26, 1, ''),
(73, 2014, '', ' Em 1942, os estúdios Disney produziram o desenho “Alô Amigos”, que apresenta a personagem Zé Carioca. Dois anos depois surgiu uma nova animação: The Three Caballeros, conhecida no Brasil como “Você já foi à Bahia?”. Nos desenhos citados, o Brasil e a América Latina são mostrados de forma simpática, através de estereótipos.', 'Para entender esses desenhos e o esforço de Walt Disney, devemos considerar o seguinte contexto:', 'a Segunda Guerra Mundial e a política de boa vizinhança.', 'o avanço da Guerra Fria e o episódio da Crise dos Mísseis de Cuba.', 'a política do “Big Stick” e os resultados da diplomacia do dólar.', 'o avanço do populismo e a tentativa de Truman de barrar esta influência.', '', 'A', '', 2, 26, 1, ''),
(74, 2019, '', 'A Agência da ONU para Refugiados (ACNUR) foi criada em dezembro de 1950 por resolução da Assembleia Geral das Nações Unidas. Iniciou suas atividades em janeiro de 1951. O Protocolo de 1967 reformou a Convenção de 1951 e expandiu o mandato da ACNUR para além das fronteiras europeias e das pessoas afetadas pela Segunda Guerra Mundial. Em 1995, a Assembleia Geral designou a ACNUR como responsável pela proteção e assistência dos apátridas em todo o mundo. Nas últimas décadas, os deslocamentos forçados atingiram níveis sem precedentes. Estatísticas recentes revelam que mais de 67 milhões de pessoas no mundo todo deixaram seus locais de origem por causa de conflitos, perseguições e graves violações de direitos humanos. (Adaptado de http://www.acnur.org/portugues/convencao-de-1951/. Acessado em 31/08/2018.)', '', 'Explique o contexto de criação da ACNUR e seu principal objetivo.', 'Levando em consideração os princípios da ONU, relacione a condição de refugiado com a noção de cidadania e de direitos humanos.', '', 'O Alto Comissariado das Nações Unidas para Refugiados, ACNUR, foi criado após a Segunda Guerra Mundial, quando a Europa ainda lidava com boa parte dos problemas decorrentes do conflito. Entre esses problemas, destaca-se o grande número de refugiados que precisaram abandonar seus países de origem. Os candidatos deveriam indicar que, nesse contexto, a ACNUR oferecia assistência aos refugiados europeus; a assistência a um público mais ampliado viria em anos posteriores, como informa o texto.', 'Os princípios da ONU garantem que “todos os seres humanos nascem livres e iguais em dignidade e direitos”. Esses princípios são mobilizados pela agência para garantir que refugiados não sejam vítimas da violação de direitos humanos e para assegurar o seu acesso à cidadania e a condições de vida que possam garantir sua integridade física.', '', NULL, 3, 26, 2, '');
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`) VALUES
(75, 2011, , 'Quando Colin Powell chegar às Nações Unidas hoje para defender a guerra contra Saddam Hussein, as Nações Unidas planejam cobrir a obra-prima de Picasso, “Guernica”, com uma capa azul. Repórteres e câmeras irão cercar o secretário de Estado (cargo equivalente ao de ministro das Relações Exteriores) na entrada do Conselho de Segurança das Nações Unidas, onde a reprodução de “Guernica” está pendurada. De fato, Powell não pode convencer o mundo sobre a necessidade de bombardear o Iraque cercado por mulheres, homens, crianças, touros e cavalos aos gritos e mutilados. (Adaptado de Maureen Dowd, “Powell without Picasso”. http://www.nytimes.com/2003/02/05/opinion/powell-without-picasso.html. Acesso em 06/12/2010.)', '', 'Quais eram as mensagens incompatíveis entre a fala de Colin Powell e a obra Guernica de Picasso? ', 'Identifique os acontecimentos políticos associados à obra Guernica.', '', 'A fala de Colin Powell tinha por objetivo a defesa dos ataques norte-americanos contra o Iraque, enquanto a obra de Picasso tinha uma mensagem pacifista, denunciando o horror da guerra.', 'Essa obra faz referência ao bombardeio da cidade espanhola de Guernica, durante a Guerra Civil Espanhola. Nessa guerra, a direita espanhola (monarquistas e nacionalistas sob o comando de Franco) recebe o apoio da Alemanha nazista, responsável pelo bombardeio. Posteriormente, esse bombardeio seria interpretado também como um ensaio ou laboratório para os bombardeios sobre alvos civis que seriam realizados na Segunda Guerra Mundial.', '', NULL, 3, 26, 2, '');

